import React, { FC } from 'react';

interface Props {
    menu?: boolean;
}

const index: FC<Props> = ({ menu }) => {
    console.log(menu);
    return (
        <div>
            <div
                className={` ${
                    menu
                        ? ' transition-all duration-1000 w-72'
                        : ' transition-all duration-1000 -w-72'
                }   h-screen bg-white z-50 absolute`}
            ></div>
        </div>
    );
};

export default index;
